void filter11x11_strm::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"width\" :  \"" << width.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"height\" :  \"" << height.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"src_V_TDATA\" :  \"" << src_V_TDATA.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"dst_V_TDATA\" :  \"" << dst_V_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"src_V_TVALID\" :  \"" << src_V_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"src_V_TREADY\" :  \"" << src_V_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dst_V_TVALID\" :  \"" << dst_V_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"dst_V_TREADY\" :  \"" << dst_V_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

